import React from "react";
import { HeroContainer, HeroWrapper, HeroH1, HeroP } from "./HeroStyles";

export default function Hero() {
  return (
    <>
      <HeroContainer>
        <HeroWrapper>
          <HeroH1>Ainne Oum</HeroH1>
          <HeroP>Frontend Engineer</HeroP>
        </HeroWrapper>
      </HeroContainer>
    </>
  );
}
